(1, 1, '2017-11-20 17:38:55', '2017-11-20 23:38:55', 'Bienvenido a WordPress. Esta es tu primera entrada. Edítala o bórrala, ¡y comienza a publicar!.', '¡Hola mundo!', '', 'publish', 'open', 'open', '', 'hola-mundo', '', '', '2017-11-20 17:38:55', '2017-11-20 23:38:55', '', 0, 'http://localhost:8888/enlace/?p=1', 0, 'post', '', 1),
(2, 1, '2017-11-20 17:38:55', '2017-11-20 23:38:55', 'Esta es una página de ejemplo, Es diferente a una entrada de un blog porque se mantiene estática y se mostrará en la barra de navegación (en la mayoría de temas). Casi todo el mundo comienza con una página \"Acerca De\" para presentarse a los potenciales visitantes. Podría ser algo así:\n\n<blockquote>¡Hola!: Soy mensajero por el día, aspirante a actor por la noche y esta es mi web. Vivo en Guadalajara, tengo un gran perro llamado Khal y me encantan las piñas coladas (y empaparme en la lluvia)</blockquote>\n\n… o algo así:\n\n<blockquote>La empresa Banpatrás XYZ se fundó en 1971, y ha estado invirtiendo el ahorro de sus clientes desde entonces. Ubicada en Ciudad Gótica, Banpatrás XYZ tiene más de 2.000 empleados e hace toda clase de cosas increíbles por la comunidad de Ciudad Gótica</blockquote>\n\nSi eres nuevo en WordPress deberías ir a <a href=\"http://localhost:8888/enlace/wp-admin/\">tu escritorio</a> para borrar esta página y crear algunas nuevas con tu contenido. ¡Diviértete!', 'Página de ejemplo', '', 'trash', 'closed', 'open', '', 'pagina-ejemplo__trashed', '', '', '2017-11-26 11:53:37', '2017-11-26 17:53:37', '', 0, 'http://localhost:8888/enlace/?page_id=2', 0, 'page', '', 0),
(4, 1, '2017-11-21 20:04:38', '2017-11-22 02:04:38', '', 'Expreso', '', 'inherit', 'open', 'closed', '', 'expreso', '', '', '2017-11-21 20:04:38', '2017-11-22 02:04:38', '', 0, 'http://localhost:8888/enlace/wp-content/uploads/2017/11/espresso.jpg', 0, 'attachment', 'image/jpeg', 0),
