(8, 1, '2017-11-21 20:04:38', '2017-11-22 02:04:38', 'Puedes ser un artista que quiere presentarse a sí mismo y a su trabajo o eres un negocio con una misión que describir.', 'Acerca de', '', 'trash', 'closed', 'closed', '', 'acerca-de__trashed', '', '', '2017-11-26 11:53:37', '2017-11-26 17:53:37', '', 0, 'http://localhost:8888/enlace/?page_id=8', 0, 'page', '', 0),
(9, 1, '2017-11-21 20:04:38', '2017-11-22 02:04:38', 'Esta es una página con información de contacto básica, como dirección y número de teléfono. Incluso puedes probar un plugin para añadir un formulario de contacto.', 'Contacto', '', 'publish', 'closed', 'closed', '', 'contactanos', '', '', '2017-11-26 11:56:34', '2017-11-26 17:56:34', '', 0, 'http://localhost:8888/enlace/?page_id=9', 0, 'page', '', 0),
(10, 1, '2017-11-21 20:04:38', '2017-11-22 02:04:38', '', 'Blog', '', 'publish', 'closed', 'closed', '', 'blog', '', '', '2017-11-21 20:04:38', '2017-11-22 02:04:38', '', 0, 'http://localhost:8888/enlace/?page_id=10', 0, 'page', '', 0),
(11, 1, '2017-11-21 20:04:38', '2017-11-22 02:04:38', 'Este es un ejemplo de una sección de la página de inicio. Las secciones de la página de inicio pueden estar en cualquier página aparte de la propia de inicio, incluida la página que muestra tus últimas entradas.', 'Una sección de página de inicio', '', 'trash', 'closed', 'closed', '', 'una-seccion-de-pagina-de-inicio__trashed', '', '', '2017-11-26 11:53:37', '2017-11-26 17:53:37', '', 0, 'http://localhost:8888/enlace/?page_id=11', 0, 'page', '', 0),
