(72, 1, '2017-11-26 11:53:37', '2017-11-26 17:53:37', 'Esta es una página de ejemplo, Es diferente a una entrada de un blog porque se mantiene estática y se mostrará en la barra de navegación (en la mayoría de temas). Casi todo el mundo comienza con una página \"Acerca De\" para presentarse a los potenciales visitantes. Podría ser algo así:\n\n<blockquote>¡Hola!: Soy mensajero por el día, aspirante a actor por la noche y esta es mi web. Vivo en Guadalajara, tengo un gran perro llamado Khal y me encantan las piñas coladas (y empaparme en la lluvia)</blockquote>\n\n… o algo así:\n\n<blockquote>La empresa Banpatrás XYZ se fundó en 1971, y ha estado invirtiendo el ahorro de sus clientes desde entonces. Ubicada en Ciudad Gótica, Banpatrás XYZ tiene más de 2.000 empleados e hace toda clase de cosas increíbles por la comunidad de Ciudad Gótica</blockquote>\n\nSi eres nuevo en WordPress deberías ir a <a href=\"http://localhost:8888/enlace/wp-admin/\">tu escritorio</a> para borrar esta página y crear algunas nuevas con tu contenido. ¡Diviértete!', 'Página de ejemplo', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2017-11-26 11:53:37', '2017-11-26 17:53:37', '', 2, 'http://localhost:8888/enlace/2017/11/26/2-revision-v1/', 0, 'revision', '', 0),
(73, 1, '2017-11-26 11:56:28', '2017-11-26 17:56:28', 'Esta es una página con información de contacto básica, como dirección y número de teléfono. Incluso puedes probar un plugin para añadir un formulario de contacto.', 'Contacto', '', 'inherit', 'closed', 'closed', '', '9-revision-v1', '', '', '2017-11-26 11:56:28', '2017-11-26 17:56:28', '', 9, 'http://localhost:8888/enlace/2017/11/26/9-revision-v1/', 0, 'revision', '', 0),
